snippet.description:
Ed ecco a voi la recensione di Raiden di Leggende Pokémon: Z-A. Un episodio che sta vendendo meno della metà di "Scarlatto & Violetto" ma che va comunque a gonfie vele. E siamo qui a parlarne dopo quasi trenta ore (e avendo finito la main quest e varie side quest), con tanto di verdetto finale e voto.

INDICE DELLA RECENSIONE:
0:00 - Introduzione e premesse;
0:13 - TRAMA e analisi della narrativa;
2:41 - GAMEPLAY;
3:08 - Struttura del gioco, mappa ed esplorazione;
4:20 - Il ciclo giorno/notte;
5:32 - Su esplorazione e verticalità;
6:00 - Quest secondarie, incarichi e dungeon;
7:19 - Difficoltà, progressione, boss fight;
10:20 - Il torneo Z-A e criticità/dubbi;
10:53 - Il combat system nello specifico;
13:50 - Nota critica sulle Megaevoluzioni;
14:18 - GRAFICA & SONORO;
16:45 - VOTO, PRO E CONTRO;
16:56 - Conclusioni e precisazioni;
19:35 - Post Scriptum.

